import React from 'react'
import { NavLink } from 'react-router-dom'

const Home = () => {
    return (
        <div className='home'>
           <h1>Welcome to the World of lulu</h1>
            <img src='../images/main-page-lulu.webp' className='home--img'/>
            <h2>Check out our lastest merch</h2>
            <NavLink to="/productpage" className="home--button">Here</NavLink>
       
        </div>
    )
}

export default Home
